import React from 'react'
import { Line,Bar } from 'react-chartjs-2'
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

const options = {
    legend: {
      display: true,
    },
    scales: {
      yAxes: [{
        ticks: { 
          min: 0, 
          stepSize: 10, 
        }
      }]
    },
    maintainAspectRatio: false 
  }
  const data = {
    datasets: [
        {
          type: 'line',
          label: 'Dataset 1',
          borderColor: 'rgb(54, 162, 235)',
          borderWidth: 2,
          data: [
            { x: 'January', y: 1 },
            { x: 'February', y: 2 },
            { x: 'March', y: 3 },
            { x: 'April', y: null },
            { x: 'May', y: 5 }
          ],
          yAxisID: 'y_sub',
        },
        {
          type: 'bar',
          label: 'Dataset 2',
          backgroundColor: 'rgb(255, 99, 132)',
          data: [
            { x: 'January', y: 14 },
            { x: 'February', y: 20 },
            { x: 'March', y: 32 },
            { x: 'April', y: 41 },
            { x: 'May', y: 15 },
            { x: 'June', y: 26 }
          ],
          borderColor: 'red',
          borderWidth: 2,
        },
        {
          type: 'bar',
          label: 'Dataset 3',
          backgroundColor: 'rgb(75, 192, 192)',
          data: [
            { x: 'January', y: 1 },
            { x: 'February', y: 2 },
            { x: 'March', y: 3 },
            { x: 'April', y: 4 },
            { x: 'May', y: 5 },
            { x: 'June', y: 6 }
          ],
          yAxisID: 'y_sub',
        },
      ],
  };
const Record = () => {
  return (
    <div>
      <Line type="line" data={data} options={options} />
    </div>
  );
};

export default Record;
